stateMachine.definition:
{
  "Comment": "A description of my state machine",
  "StartAt": "Retrieve Connection Data",
  "States": {
    "Retrieve Connection Data": {
      "Type": "Task",
      "Resource": "arn:aws:states:eu-west-1:322313019878:activity:int-port-local-ip_retrieve_connection_data",
      "Next": "Register Package",
      "Parameters": {
        "packageFlow": "P2V_S3",
        "connectionIdSource.$": "$.connectionId"
      },
      "Retry": [
        {
          "ErrorEquals": [
            "States.ALL"
          ],
          "IntervalSeconds": 10,
          "MaxAttempts": 2
        }
      ],
      "ResultPath": "$.retrieveConnection"
    },
    "Register Package": {
      "Type": "Task",
      "Resource": "arn:aws:states:eu-west-1:322313019878:activity:int-port-local-ip_register_package",
      "Next": "Transfer Updates To SEG",
      "Parameters": {
        "packageFlow": "P2V_S3",
        "executionId.$": "$$.Execution.Id",
        "connection.$": "$.retrieveConnection.connection"
      },
      "ResultPath": "$.registerPackage",
      "Retry": [
        {
          "ErrorEquals": [
            "States.ALL"
          ],
          "IntervalSeconds": 10,
          "MaxAttempts": 2
        }
      ]
    },
    "Transfer Updates To SEG": {
      "Type": "Task",
      "Resource": "arn:aws:states:eu-west-1:322313019878:activity:int-port-local-ip_transfer_to_seg",
      "Parameters": {
        "packageSK.$": "$.registerPackage.package.sk",
        "connection.$": "$.retrieveConnection.connection"
      },
      "Retry": [
        {
          "ErrorEquals": [
            "States.ALL"
          ],
          "IntervalSeconds": 10,
          "MaxAttempts": 2
        }
      ],
      "ResultPath": "$.s3Updates",
      "Next": "Upload To Valeo Nexus"
    },
    "Upload To Valeo Nexus": {
      "Type": "Task",
      "Resource": "arn:aws:states:eu-west-1:322313019878:activity:int-port-local-ip_upload_to_nexus",
      "Parameters": {
        "packageSK.$": "$.registerPackage.package.sk",
        "connection.$": "$.retrieveConnection.connection"
      },
      "ResultPath": "$.uploadPackageDocuments",
      "End": true
    }
  }
}
